import React, { Component } from 'react'
import {FaSignInAlt} from 'react-icons/fa'
export default class Login extends Component {
    render() {
        return (
            <div style = {{width: '30rem'}} >
                <form>
                    <h3 className = 'font-weight-normal' style = {{textAlign: 'center'}}>Welcome back! please sign in</h3>
                    <input className = 'form-control' type = 'text' placeholder = 'Username' required autoFocus/>
                    <input className = 'form-control' type = 'password' placeholder = 'Password' required/>
                    <button className = 'btn btn-success btn-block mb-4 mt-2'type = 'submit' ><FaSignInAlt/> Login</button>
                </form>
            </div>
        )
    }
}
